import { 
  composeBundles,
  createUrlBundle,
  createCacheBundle
} from 'redux-bundler';

import {
  createAuthBundle,
  createOlMapBundle,
  createOlBasemapBundle,
  createJwtApiBundle
} from '@corpsmap/corpsmap/src/application-bundles-old/auth-bundle';

import cache from '@corpsmap/corpsmap/src/utils/cache'

import routesBundle from './routes-bundle';

import drawBundle from './draw-bundle';

export default composeBundles(
  routesBundle,
  createUrlBundle(),
  createCacheBundle(cache.set),
  createAuthBundle({
    appId: '17de6a86-32a9-47fc-9fa5-e98a400111b3',
    redirectOnLogout: '/'
  }),
  drawBundle
);
